import React from "react"

class Summary extends React.Component {
    render() {
        return (
            <div className='workspace-container'>
                <div>
                    <h1>DETAILS</h1>
                    <div style={{ marginTop: "5px" }}>{this.props.name}</div>
                </div>
            </div>
        )
    }
}

export default Summary
